import {Component} from 'react';

class Navigation extends Component{
  render(){
    return(
        <nav>
          <ul>
              <li><a href="1.html">{this.props.member01}</a></li>
          </ul>
        </nav>
      );
  }

}

// 클래스 이름과 동일해야 합니다.
export default Navigation;
